 Hello! Binary trees are a type of tree data structure where each node has at most two child nodes, referred to as the left and right child. This differs from a binary search tree, where each node also has a value stored in it. The value at each node is commonly referred to as the key of the node, and the value stored in the left and right child nodes is determined by the key stored in the parent node.

In Python, you can represent a binary tree using a class. The class can have methods for creating nodes, adding nodes to the tree, deleting nodes, and traversing the tree.

Here's a simple example of a binary tree class in Python:
```python
class BinaryTree:
    def __init__(self):
        self.root = None

    def addChild(self, val):
        if self.root is None:
            self.root = val
        else:
            self.root.addChild(val)

    def traverse(self):
        if self.root is None:
            return []
        else:
            return [self.root.val] + self.root.traverse()

    def size(self):
        if self.root is None:
            return 0
        else:
            return 1 + self.root.traverse()[0]
```
In this example, the `addChild` method is used to add new nodes to the tree, the `traverse` method is used to traverse the tree and the `size` method is used to determine the size of the tree (i.e. the number of nodes in the tree). The `val` parameter is the value stored in the new node.

You can then use this binary tree class to create and traverse trees as follows:
```python
# create a new binary tree
bt = BinaryTree()

# add nodes to the tree
bt.addChild(10)
bt.addChild(20)
bt.addChild(30)

# traverse the tree
tree = bt.traverse()

# print the size of the tree
print(tree)  # [10]
