 Here is a simple implementation of bubble sort in Python:
```python
def bubble_sort(arr):
    n = len(arr)
    for i in range(n):
        for j in range(n - i - 1):
            if arr[j] > arr[j + 1]:
                arr[j], arr[j + 1] = arr[j + 1], arr[j]
    return arr
```
This function takes an array as input and returns the sorted array. It loops through the array n times, comparing adjacent elements and swapping them if necessary. The outer loop iterates through the array from left to right, while the inner loop iterates through the array from right to left. The algorithm repeats this process until no more swaps are made. This is a simple implementation that works by comparing adjacent elements and swapping them if necessary. A more efficient implementation would perform multiple passes over the array to reduce the number of swaps, but this is not necessary for small arrays.

